import { Form, Input } from 'antd';
import React, { FC, useState } from 'react';

export const LoginForm: FC = () => {
  const [ID, setId] = useState<string>();
  const [password, setPassword] = useState<string>();

  return (
    <Form>
      <div>
        <label htmlFor='user-id'>ID</label>
        <br />
        <Form.Item>
          <Input name='user-id' />
        </Form.Item>
      </div>
    </Form>
  );
};
